import React,  { Component } from 'react';
import Layout from '../components/Layout';

export default class extends Component {
    render () {
        return (
            <Layout>
            <div className="container">
                <h1 class="text-success">Hey, got plants tonight?</h1>
            </div>
        </Layout>
        )
    }
}
